import React, { Component } from 'react';
import Navbar from 'react-bootstrap/Navbar';

const Nav_Bar = (props) => {
  return (
    <div>
      <Navbar bg="dark" variant="dark">
        <Navbar.Brand>Logo</Navbar.Brand>
      </Navbar>
    </div>
  );
};

export default Nav_Bar;
